class FileText:
    def __init__(self, filetext):
        self._file = filetext
        self._list = []

    def op(self):

        with open(self._file, 'rt') as FileInput:
            self._list = FileInput.readlines()

        with open('list.txt', 'wt') as FileOutput:
            FileOutput.write(str(self._list))
        return self._file




